IF OBJECT_ID('dbo.staging_table_415', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.staging_table_415 (
        id INT IDENTITY(1,1) PRIMARY KEY,
        payload NVARCHAR(MAX),
        created_on DATETIME2 DEFAULT SYSUTCDATETIME()
    );
END
GO

GO

GO

GO

GO

